import Link from 'next/link';

const Navbar = () => (
  <div>
    <ul>
      <li>
        <Link href='/'>
          <a>Koti</a>
        </Link>
      </li>
      <li>
        <Link href='/about'>
          <a>UKK</a>
        </Link>
      </li>
    </ul>

    <style jsx>{`
      ul {
        background: #333;
        color: #fff;
        list-style: none;
        display: flex;
      }
    `}</style>
  </div>
);

export default Navbar;
